import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Container, Grid, Typography } from '@mui/material';
import { motion } from 'framer-motion';
import Particles from 'react-tsparticles'; // นำเข้า Particles

export default function Home() {
  const navigate = useNavigate();

  const navigateTo = (page) => {
    navigate(`/${page}`);
  };

  const particlesInit = (main) => {
    console.log(main);
  };

  const particlesLoaded = (container) => {
    console.log(container);
  };

  const styles = {
    container: {
      position: 'relative',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
      color: '#ffffff',
      overflow: 'hidden',
    },
    button: {
      margin: '20px',
      padding: '15px 30px',
      fontSize: '20px',
      borderRadius: '30px',
      position: 'relative',
      overflow: 'hidden',
      fontWeight: 'bold',
      textTransform: 'uppercase',
      backgroundColor: '#4A90E2', // สีฟ้าที่ไม่แสบตา
      boxShadow: '0 5px 15px rgba(0,0,0,0.2)',
      transition: 'transform 0.3s ease, background-color 0.3s ease',
      '&:hover': {
        transform: 'scale(1.05)',
        backgroundColor: '#357ABD', // สีฟ้าที่เข้มขึ้นเมื่อโฮเวอร์
        boxShadow: '0 15px 25px rgba(0, 0, 0, 0.3)',
      },
      '&:active': {
        transform: 'scale(0.95)',
        boxShadow: '0 5px 15px rgba(0,0,0,0.2)',
      },
    },
    title: {
      marginBottom: '40px',
      fontSize: '3rem',
      textAlign: 'center',
      fontWeight: 'bold',
      textShadow: '2px 2px 4px rgba(0, 0, 0, 0.5)',
      animation: 'rainbow 5s infinite linear, move 1.5s infinite alternate ease-in-out',
      background: 'linear-gradient(270deg, #FFB74D, #FF9800, #FB8C00, #F57C00)', // โทนสีอบอุ่น
      backgroundSize: '400% 400%',
      WebkitBackgroundClip: 'text',
      WebkitTextFillColor: 'transparent',
    },
    buttonContainer: {
      position: 'relative',
      '&:hover::after': {
        content: '""',
        position: 'absolute',
        top: '0',
        left: '0',
        right: '0',
        bottom: '0',
        backgroundColor: 'rgba(255, 255, 255, 0.1)',
        borderRadius: '30px',
        transition: 'opacity 0.3s ease',
        opacity: '1',
      },
      '&::after': {
        content: '""',
        position: 'absolute',
        top: '0',
        left: '0',
        right: '0',
        bottom: '0',
        backgroundColor: 'rgba(255, 255, 255, 0.1)',
        borderRadius: '30px',
        transition: 'opacity 0.3s ease',
        opacity: '0',
      },
    },
    '@keyframes rainbow': {
      '0%': { backgroundPosition: '0% 50%' },
      '100%': { backgroundPosition: '100% 50%' },
    },
    '@keyframes move': {
      '0%': { transform: 'translateX(-10px)' },
      '100%': { transform: 'translateX(10px)' },
    },
  };

  return (
    <Container style={styles.container}>
      <Particles
        id="tsparticles"
        init={particlesInit}
        loaded={particlesLoaded}
        options={{
          background: {
            color: {
              value: "#16213E", // สีพื้นหลัง
            },
          },
          fpsLimit: 120,
          particles: {
            number: {
              value: 100, // จำนวนอนิเมชั่น
              density: {
                enable: true,
                value_area: 800,
              },
            },
            color: {
              value: "#ffffff", // สีของอนิเมชั่น
            },
            shape: {
              type: "circle",
              stroke: {
                width: 0,
                color: "#000000",
              },
              polygon: {
                nb_sides: 5,
              },
              image: {
                src: "img/github.svg",
                width: 100,
                height: 100,
              },
            },
            opacity: {
              value: 0.5,
              random: false,
              anim: {
                enable: false,
                speed: 1,
                opacity_min: 0.1,
                sync: false,
              },
            },
            size: {
              value: 3,
              random: true,
              anim: {
                enable: false,
                speed: 40,
                size_min: 0.1,
                sync: false,
              },
            },
            move: {
              enable: true,
              speed: 6,
              direction: "none",
              random: false,
              straight: false,
              out_mode: "out",
              bounce: false,
              attract: {
                enable: false,
                rotateX: 600,
                rotateY: 1200,
              },
            },
          },
          interactivity: {
            detect_on: "canvas",
            events: {
              onClick: {
                enable: true,
                mode: "push",
              },
              onHover: {
                enable: true,
                mode: "repulse",
              },
              resize: true,
            },
            modes: {
              grab: {
                distance: 400,
                line_linked: {
                  opacity: 1,
                },
              },
              bubble: {
                distance: 400,
                size: 40,
                duration: 2,
                opacity: 8,
                speed: 3,
              },
              repulse: {
                distance: 200,
                duration: 0.4,
              },
              push: {
                quantity: 4,
              },
              remove: {
                quantity: 2,
              },
            },
          },
          retina_detect: true,
        }}
      />
      <Typography variant="h1" style={styles.title}>
        Welcome to GlaHarn
      </Typography>
      <Grid container justifyContent="center">
        <div style={styles.buttonContainer}>
          <motion.div whileHover={{ scale: 1.05 }}>
            <Button
              variant="contained"
              style={styles.button}
              onClick={() => navigateTo('CheckBill')}
            >
              Check Bill
            </Button>
          </motion.div>
        </div>

        <div style={styles.buttonContainer}>
          <motion.div whileHover={{ scale: 1.05 }}>
            <Button
              variant="contained"
              style={styles.button}
              onClick={() => navigateTo('summary')}
            >
              Summary Slip
            </Button>
          </motion.div>
        </div>

        <div style={styles.buttonContainer}>
          <motion.div whileHover={{ scale: 1.05 }}>
            <Button
              variant="contained"
              style={styles.button}
              onClick={() => navigateTo('statusdebtor')}
            >
              Status Debtor
            </Button>
          </motion.div>
        </div>
      </Grid>
    </Container>
  );
}
